description:
Avec le service de Tiva\_à la demande, l'Intercom de la Vire au Noireau déploie son réseau de transport à l'ensemble des zones rurales à partir de novembre 2024.&#x20;
Historiquement appelé "Tadami" ce service est désormais proposé sur l'ensemble du territoire pour tous les habitants (sauf scolaires).  Concrètement 2 véhicules électriques d'une capacité de 8 personnes sillonnent le territoire. Les habitants sont récupérés à leur domicile et déposés à l'un des 22 points de dépose. Les trajets doivent être réalisés à l'avance par téléphone, via l'application ou sur le site internet.  Le tarif unique est de 2€. 
Le jeu de données est au format GTFS .
